// TravelRegistrationForm.jsx - Form for registering travel information

import React, { useState } from 'react';
import axios from 'axios';
import { useForm } from 'react-hook-form';
import './TravelRegistrationForm.css'; 

const TravelRegistrationForm = ({ userId, userIsVip }) => {
  const { register, handleSubmit, formState: { errors }, reset, setValue } = useForm();
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState(null);
  const [showConflictModal, setShowConflictModal] = useState(false);
  const [conflictData, setConflictData] = useState(null);
  const [travelTypes, setTravelTypes] = useState(['Flight', 'Train', 'Car', 'Other']);
  const [selectedTravelType, setSelectedTravelType] = useState('Flight');

  const onSubmit = async (data) => {
    setLoading(true);
    setMessage(null);

    try {
      const response = await axios.post('/api/travel', {
        user_id: userId,
        travel_type: data.travelType,
        departure_location: data.departureLocation,
        arrival_location: data.arrivalLocation,
        departure_time: data.departureTime,
        arrival_time: data.arrivalTime,
        flight_number: data.flightNumber,
        airline: data.airline,
        confirmation_code: data.confirmationCode
      });

      // Handle success
      setMessage({ type: 'success', text: response.data.message || 'Travel information saved successfully!' });

      // If there's a non-conflict warning, show it
      if (response.data.message && !response.data.success) {
        setMessage({ type: 'warning', text: response.data.message });
      }

      reset();
    } catch (error) {
      console.error('Error saving travel info:', error);

      // Handle VIP conflict
      if (error.response && error.response.status === 409) {
        setConflictData(error.response.data);
        setShowConflictModal(true);
      } else {
        setMessage({ 
          type: 'danger', 
          text: error.response?.data?.message || 'Error saving travel information. Please try again.'
        });
      }
    } finally {
      setLoading(false);
    }
  };

  const handleTravelTypeChange = (e) => {
    setSelectedTravelType(e.target.value);
  };

  const handleSuggestedFlightSelect = (flight) => {
    setValue('airline', flight.airline);
    setValue('flightNumber', flight.flight_number);
    setValue('departureTime', flight.departure_time);
    setValue('arrivalTime', flight.arrival_time);
    setShowConflictModal(false);
  };

  return (
    <div className="travel-card">
      <div className="travel-card-header">Travel Information</div>
      <div className="travel-card-body">
        {message && (
          <div className={`alert alert-${message.type} alert-dismissible`}>
            <button 
              type="button" 
              className="close" 
              onClick={() => setMessage(null)}
            >
              &times;
            </button>
            {message.text}
          </div>
        )}

        <form onSubmit={handleSubmit(onSubmit)}>
          <div className="form-group">
            <label className="form-label">Travel Method</label>
            <select 
              className={`form-select ${errors.travelType ? 'is-invalid' : ''}`}
              {...register('travelType', { required: 'Travel method is required' })}
              onChange={handleTravelTypeChange}
            >
              {travelTypes.map(type => (
                <option key={type} value={type}>{type}</option>
              ))}
            </select>
            {errors.travelType && (
              <div className="invalid-feedback">
                {errors.travelType.message}
              </div>
            )}
          </div>

          <div className="form-group">
            <label className="form-label">Departure Location</label>
            <input 
              type="text" 
              className={`form-control ${errors.departureLocation ? 'is-invalid' : ''}`}
              placeholder="City, Airport, etc."
              {...register('departureLocation', { required: 'Departure location is required' })}
            />
            {errors.departureLocation && (
              <div className="invalid-feedback">
                {errors.departureLocation.message}
              </div>
            )}
          </div>

          <div className="form-group">
            <label className="form-label">Arrival Location</label>
            <input 
              type="text" 
              className={`form-control ${errors.arrivalLocation ? 'is-invalid' : ''}`}
              placeholder="City, Airport, etc."
              {...register('arrivalLocation', { required: 'Arrival location is required' })}
            />
            {errors.arrivalLocation && (
              <div className="invalid-feedback">
                {errors.arrivalLocation.message}
              </div>
            )}
          </div>

          {selectedTravelType === 'Flight' && (
            <>
              <div className="form-group">
                <label className="form-label">Airline</label>
                <input 
                  type="text" 
                  className={`form-control ${errors.airline ? 'is-invalid' : ''}`}
                  placeholder="Enter airline name"
                  {...register('airline', { required: 'Airline is required for flights' })}
                />
                {errors.airline && (
                  <div className="invalid-feedback">
                    {errors.airline.message}
                  </div>
                )}
              </div>

              <div className="form-group">
                <label className="form-label">Flight Number</label>
                <input 
                  type="text" 
                  className={`form-control ${errors.flightNumber ? 'is-invalid' : ''}`}
                  placeholder="e.g., UA123"
                  {...register('flightNumber', { required: 'Flight number is required' })}
                />
                {errors.flightNumber && (
                  <div className="invalid-feedback">
                    {errors.flightNumber.message}
                  </div>
                )}
              </div>

              {userIsVip && (
                <div className="alert alert-info">
                  As a VIP attendee, your flight will be checked against other VIPs to prevent booking conflicts.
                </div>
              )}
            </>
          )}

          <div className="row">
            <div className="col-md-6">
              <div className="form-group">
                <label className="form-label">Departure Date/Time</label>
                <input 
                  type="datetime-local" 
                  className={`form-control ${errors.departureTime ? 'is-invalid' : ''}`}
                  {...register('departureTime', { required: 'Departure time is required' })}
                />
                {errors.departureTime && (
                  <div className="invalid-feedback">
                    {errors.departureTime.message}
                  </div>
                )}
              </div>
            </div>

            <div className="col-md-6">
              <div className="form-group">
                <label className="form-label">Arrival Date/Time</label>
                <input 
                  type="datetime-local" 
                  className={`form-control ${errors.arrivalTime ? 'is-invalid' : ''}`}
                  {...register('arrivalTime', { required: 'Arrival time is required' })}
                />
                {errors.arrivalTime && (
                  <div className="invalid-feedback">
                    {errors.arrivalTime.message}
                  </div>
                )}
              </div>
            </div>
          </div>

          <div className="form-group">
            <label className="form-label">Confirmation Code (Optional)</label>
            <input 
              type="text" 
              className="form-control"
              placeholder="Reservation or confirmation code"
              {...register('confirmationCode')}
            />
          </div>

          <button 
            className="btn btn-primary" 
            type="submit" 
            disabled={loading}
          >
            {loading ? 'Saving...' : 'Save Travel Information'}
          </button>
        </form>
      </div>

      {/* VIP Conflict Modal */}
      {showConflictModal && (
        <div className="modal" style={{ display: 'block' }}>
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">VIP Travel Conflict Detected</h5>
                <button 
                  type="button" 
                  className="close" 
                  onClick={() => setShowConflictModal(false)}
                >
                  &times;
                </button>
              </div>
              <div className="modal-body">
                <p>{conflictData?.message}</p>

                {conflictData?.suggested_flights?.length > 0 && (
                  <>
                    <h6>Suggested Alternative Flights:</h6>
                    <div className="list-group">
                      {conflictData.suggested_flights.map((flight, index) => (
                        <button
                          key={index}
                          className="list-group-item list-group-item-action"
                          onClick={() => handleSuggestedFlightSelect(flight)}
                        >
                          {flight.airline} {flight.flight_number} - Departs: {flight.departure_time}
                        </button>
                      ))}
                    </div>
                  </>
                )}
              </div>
              <div className="modal-footer">
                <button 
                  className="btn btn-secondary" 
                  onClick={() => setShowConflictModal(false)}
                >
                  Close
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default TravelRegistrationForm;
